### Example 1: Hardcoded strings in JavaScript

In a library or book order platform, you might have a function that displays a success message when an order is placed. However, if the message is hardcoded in English, it will not be translated for users who prefer other languages.

**Non-i18n compliant code:**
```javascript
function displaySuccessMessage() {
  alert("Order placed successfully!");
}
```
**I18n compliant code:**
```javascript
import i18n from 'i18next';

function displaySuccessMessage() {
  const message = i18n.t('order_placed_successfully');
  alert(message);
}
```
In the i18n compliant code, we use the `i18next` library to translate the message. We define a key `order_placed_successfully` in our translation files (e.g., `en.json`, `fr.json`, etc.) and use the `i18n.t()` function to retrieve the translated message.

**Translation files:**

`en.json`:
```json
{
  "order_placed_successfully": "Order placed successfully!"
}
```
`fr.json`:
```json
{
  "order_placed_successfully": "Commande passée avec succès !"
}
```
**Best practice:** Use a consistent naming convention for your translation keys, and keep them organized in a separate file or directory.

